import React from "react";

const App = () => {

  return <>
          <Logo />
          <BestPokemon />
          <CaughtPokemon />
       </>
}
const Logo = () => {
const appName = "Pokedex"
    return <>
            <header>
              <h1>Welcome to Pokedex</h1>
              <img src="https://assets.pokemon.com/assets/cms2/img/pokedex/full/016.png"></img>
              <p>{appName}</p>
            </header>
 </>

}


const BestPokemon = () => {
const abilities = ['Anticipation', 'Adaptability', 'Run-Away']
        return  <>
                  <ul>
                    { abilities.map((name) =>(
                      <li>{name}</li>))}
                  </ul>
                  <p>Para mi el mejor pokemon es El mago oscuro</p>
                </>
}

const CaughtPokemon = () => {
  const date = new Date().toLocaleDateString();

  return <>
            <p>Caught 0 Pokemon on</p>
            <p>{date}</p> 
           </> 

}

export default App;
